    "2015-09-01T18:28:15.471003",nt"name": "women-infants-and-children-wic-income-eligibility-guidelines-2014-2015",nt"isopen":
    true,nt"url": null,nt"notes": "On March 5, 2014, a Notice announcing revised
    WIC Income Eligibility Guidelines was published in the Federal Register. The adjusted
    income eligibility guidelines are used by State agencies in determining the income
    eligibility of persons applying to participate in the WIC Program. WIC State agencies
    must implement the new guidelines not later than July 1, 2014. WIC State agencies
    may implement the revised income guidelines at the same time States implement revised
    income eligibility guidelines for the Medicaid Program. On January 22, 2014, the
    U.S. Department of Health and Human Services (HHS) published its annual update of
    the poverty guidelines (79 FR 3593). The HHS guidelines are used by a number of
    Federal programs, including WIC and the Medicaid Program, as the basis for determining
    and updating program income eligibility limits.",nt"license_title": "Creative
